    const [colors, setColors] = useState([
        'rgba(179,0,0,0.75)', 
        'rgba(227,74,51,0.75)', 
        'rgba(252,141,89,0.75)',
        'rgba(253,187,132,0.75)',
        'rgba(253,212,158,0.75)',
        'rgba(254,240,217,0.75)',
        'rgba(180,180,180,0.75)',    
    ])
   
    const { title } = props
    return (
        <>
         <p>{title}</p>
        </>
    )
}

